  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Tinicum
  National Wildlife Refuge outlines Refuge accomplishments during the 1992 calendar
  year. The report begins with a summary of the year's highlights and weather conditions.
  Land acquisition is covered. The report includes a planning section which discusses
  the management plan and public participation. Refuge administration is outlined;
  information about personnel, other manpower programs, volunteer programs, funding,
  safety, and technical assistance is given. Habitat management is also covered; subjects
  include wetlands, forests, grasslands, fire management, and pest control. The wildlife
  section of the report discusses wildlife diversity, endangered and threatened species,
  waterfowl, mash and water birds, shorebirds, raptors, other migratory birds, game
  mammals, other resident wildlife, fisheries resources, scientific collections, marking
  and bird banding, resource contamination assessment, and environmental contamination
  evaluation. The public uses of the Refuge described in this report include outdoor
  classrooms, interpretive programs, fishing, wildlife observation, and law enforcement.
  The equipment and facilities section of the report provides information about new
  construction, major maintenance, equipment utilization and replacement, communications
  systems, and computer systems. Cooperative programs and items of interest are provided
  at the end. Photographs and refuge brochures are attached.\",\n\t\"owner_org\":
